INSERT INTO `artikel` (`id`, `url`, `name`, `description`) VALUES
(1, '/web/resources/books/overlord/Overlord_Volume_1.webp', 'Overlord Volume 1: The Undead King', 'The Undead King is the first light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on July 30, 2012. It details about Satoru Suzuki, whose game avatar known as Momonga, a player of YGGDRASIL, who suddenly finds his consciousness trapped in his avatar and all of the NPCs around him begin to gain sentience. He must struggle to find a way to survive in the New World. '),
(2, '/web/resources/books/overlord/Overlord_Volume_2.webp', 'Overlord Volume 2: The Dark Warrior', 'The Dark Warrior is the second light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on November 30, 2012. It details about Ainz Ooal Gown as Momon and Narberal Gamma as Nabe and their ascension to fame as adventurers in the Re-Estize Kingdom. '),
(3, '/web/resources/books/overlord/Overlord_Volume_3.webp', 'Overlord Volume 3: The Bloody Valkyrie', 'The Bloody Valkyrie is the third light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on March 30, 2013. It details about Ainz Ooal Gown stopping Shalltear Bloodfallen\'s rebellion before she causes any more problems for his future plans in the New World. '),
(4, '/web/resources/books/overlord/Overlord_Volume_4.webp', 'Overlord Volume 4: The Lizard Man Heroes', 'The Lizard Man Heroes is the fourth light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on July 31, 2013. It details about the Lizardmen trying to save their tribe from the undead forces and total annihilation at the Great Lake. '),
(5, '/web/resources/books/overlord/Overlord_Volume_5.webp', 'Overlord Volume 5: The Men in the Kingdom', 'The Men in the Kingdom is the fifth light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on December 28, 2013. It details about Sebas Tian, Climb, and Brain Unglaus\' fight against the Eight Fingers that rules the underground society in the Royal Capital. '),
(6, '/web/resources/books/overlord/Overlord_Volume_6.webp', 'Overlord Volume 6: The Men in the Kingdom', 'The Men in the Kingdom is the sixth light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on January 31, 2014. It details about the Men of the Kingdom that will fight against an underground syndicate, but a mysterious great demon, Jaldabaoth starts a disturbance in the Royal Capital that leads to an intense battle. '),
(7, '/web/resources/books/overlord/Overlord_Volume_7.webp', 'Overlord Volume 7: The Invaders of the Large Tomb', 'The Invaders of the Large Tomb is the seventh light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on August 30, 2014. It details about a certain group of workers who volunteered to explore and investigate a mysterious Large Tomb. '),
(8, '/web/resources/books/overlord/Overlord_Volume_8.webp', 'Overlord Volume 8: The Two Leaders', 'The Two Leaders is the eighth light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on December 26, 2014. It details about the side stories of Enri Emmot becoming the new village chief of Carne Village and Ainz Ooal Gown\'s daily life in the Great Tomb of Nazarick. '),
(9, '/web/resources/books/overlord/Overlord_Volume_9.webp', 'Overlord Volume 9: The Magic Caster of Destroy', 'The Magic Caster of Destroy is the ninth light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on June 29, 2015. It details about the annual war between the Re-Estize Kingdom and the Baharuth Empire is near its end. Ainz Ooal Gown enters the war and later became known as the Magic Caster who destroyed an army. '),
(10, '/web/resources/books/overlord/Overlord_Volume_10.webp', 'Overlord Volume 10: The Ruler of Conspirancy', 'The Ruler of Conspiracy is the tenth light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on May 30, 2016. It details about Ainz Ooal Gown\'s decision to turn his kingdom into a utopia for all races. Meanwhile, rulers of other countries are plotting to oppose him and his newly founded nation. '),
(11, '/web/resources/books/overlord/Overlord_Volume_11.webp', 'Overlord Volume 11: The Craftsman of Dwarf', 'The Craftsman of Dwarf is the eleventh light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on September 30, 2016. It details about Ainz Ooal Gown, Shalltear Bloodfallen, and Aura Bella Fiora\'s visit to the Dwarf Kingdom in the Azerlisia Mountains. However, they discover that the dwarves are being threatened by the Quagoa and the Frost Dragons.'),
(12, '/web/resources/books/overlord/Overlord_Volume_12.webp', 'Overlord Volume 12: The Paladin of the Holy Kingdom', 'The Paladin of the Holy Kingdom is the twelfth light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on September 30, 2017. It details about the Roble Holy Kingdom seeking aid from Sorcerer King Ainz Ooal Gown to battle against the allied army of demi-humans commanded by Demon Emperor Jaldabaoth. '),
(13, '/web/resources/books/overlord/Overlord_Volume_13.webp', 'Overlord Volume 13: The Paladin of The Holy Kingdom', 'The Paladin of the Holy Kingdom is the thirteenth light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on April 27, 2018. It details about Ainz Ooal Gown\'s death when he faces against the Demon Emperor Jaldabaoth and his Demon Maids. While the Liberation Army struggles against the allied army of demi-humans, that have surrounded them and is about to destroy them once and for all.'),
(14, '/web/resources/books/overlord/Overlord_Volume_14.webp', 'Overlord Volume 14: The Witch of the Falling Kingdom', 'The Witch of the Falling Kingdom is the fourteenth light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin, it was released on March 12, 2020. It details the Sorcerer Kingdom\'s conflict with the Re-Estize Kingdom and Ainz Ooal Gown\'s confrontation with Platinum Dragon Lord. '),
(15, '/web/resources/books/overlord/Overlord_Volume_15.webp', 'Overlord Volume 15: The Half Elf God-kin', 'The Half Elf God-kin is the fifteenth light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin. It was released in June 30, 2022. It details about Ainz Ooal Gown, Aura Bella Fiora, and Mare Bello Fiore\'s visit to the Elf Country. However, the country is facing a major offensive of the Slane Theocracy to finish off the elves and eliminate the Elf King. '),
(16, '/web/resources/books/overlord/Overlord_Volume_16.webp', 'Overlord Volume 16: The Half Elf God-kin', 'The Half Elf God-kin is the upcoming sixteenth light novel volume in the Overlord series. Written by Kugane Maruyama and illustrated by so-bin. It will be released in July 29, 2022. ');
